import { SET_ALERT, REMOVE_ALERT } from '../types';

const contactReducer = (state, action) => {
  switch (action.type) {
    case SET_ALERT:
      return [...state, action.payload];
    case SET_ALERT:
      return [...state, action.payload];
    default:
      return state;
  }
};

export default contactReducer;
